import React, {useState, useEffect} from "react";

function SidaSammanlagdStats({patienter}) {
  const [totaltAntal, setTotaltAntal] = useState(0);

  useEffect(() => {
    setTotaltAntal(patienter.length);
  }, [patienter]);

  return <div>Totalt antal patienter: {totaltAntal}</div>;
}

export default SidaSammanlagdStats;
